module.exports = JSON.parse('{"about":{"img":"/images/travels-in-the-other-india.jpg","title":"Welcome to India\'s far East","text":"Over the years, we have actively worked towards facilitating experiential travel which is Active, Interactive and Authentic in its truest form. Our tours of Northeast India include Cycling, Treks & Walks, Motorcycle & Overland, Multi-Activity, Family Adventures, Wildlife, Culture and Youth travel , all of which have local history, culture, interactions and the environment as their centerpiece.","btnlink":"/about-us","btntext":"Know More"}}');

